package expression.generic;public class GenericDivide<T> extends GenericOperation<T> {    public GenericDivide(GenericGeneralExpression<T> first, GenericGeneralExpression<T> second, NumberMode<T> calculator) {        super.first = first;        super.second = second;        super.sign = " / ";        super.calculator = calculator;    }    public T operation(T first, T second) {        return calculator.divide(first, second);    }}